import React from "react";
import ContactAnimation from "../Animation/ContactAnimation.js";
import "./Contact.css";
const Contact = () => {
  return (
    <div className="row">
      <div className="col-12 ">
        <div className="row">
          <div className="col-12 bg-black text-center pt-5 ">
            <ContactAnimation />
          </div>
          <div>
            <div className="layer layer1"></div>
          </div>
        </div>
      </div>
    </div>
  );
};

export default Contact;
